import React from 'react';
import classes from './Header.module.css';
import mealsImg from '../../Assets/meals.jpg';
export const Header = () => {
  return (
    <>
      <header className={classes.header}>
        <h1>Chai Sutta Bar</h1>
        <button>Cart</button>
      </header>
      <div className={classes['main-image']}>
        {/* <img className={classes['main-image']} src={mealsImg} alt="chai" /> */}
        <img
          src="https://images.unsplash.com/photo-1646294567230-b56cb0cd1f5b?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1740&q=80"
          alt="chai"
        />
      </div>
    </>
  );
};
